import React from 'react'

const Sobre = () => {
    return (
        <div className='min-h-screen container mx-auto'>
            
        <h1>sobre</h1>
        <a href='https://coronavirus.saude.gov.br/sobre-a-doenca#como-se-proteger' target>
        <img className='h-28 mx-auto py-4' src='/saude.png' />
        </a>
        </div>
    )
}

export default Sobre
